  <style>
  .outerDiv
  {
    padding: 6px;
    width: 100%;
    height: 100%;
    box-sizing: border-box;
    line-height: 0;
    text-align: center;
  }
  
  .verticalSpacer
  {
    height: 6px;
  }
  
  .heading
  {
    height: 18px;
    font: 14px sans-serif;
    line-height: 18px;
  }
  
  input
  {
    position: absolute;
    display: none;
  }
  
  input + label:before
  {
    content: '';
    display: inline-block;
    width: 12px;
    height: 12px;
    border-radius: 6px;
    box-sizing: border-box;
    border-width: 1px;
    border-style: solid;
    margin-right: 3px;
    vertical-align: bottom;
  }
  
  input:checked + label:before
  {
    background-color: transparent;
  }
  
  label
  {
    height: 12px;
    font: 12px sans-serif;
    line-height: 12px;
    margin-right: 3px;
    cursor: pointer;
    user-select: none;
  }
  
  text
  {
    fill: black;
  }
  
  .innerSVG
  {
    width: 990px;
    height: 564px;
  }
  
  .axis
  {
    stroke: black;
  }
  
  .axisLabel
  {
    font: 12px sans-serif;
  }
  
  .plotLine
  {
    fill: none;
  }
  
  #Plot16Checkbox + label:before
  {
    background-color: rgb( 241, 199, 78 );
    border-color: rgb( 241, 199, 78 );
  }
  
  #Plot16Checkbox:not(:checked) + label:before
  {
    background-color: transparent;
  }
  
  #Plot16Checkbox:not(:checked) ~ svg #Plot16Line
  {
    visibility: hidden;
  }
  
  #Plot16Line
  {
    stroke: rgb( 241, 199, 78 );
  }
  
  #Plot16Checkbox + label:hover ~ svg #Plot16Line
  {
    stroke-width: 3;
  }
  
  #Plot17Checkbox + label:before
  {
    background-color: rgb( 81, 169, 240 );
    border-color: rgb( 81, 169, 240 );
  }
  
  #Plot17Checkbox:not(:checked) + label:before
  {
